import React from 'react';

function SearchResults(props) {
    return (
        <div>
            <div className='search-result'></div>
            <div className='left'>
            <img src='https://www.superherodb.com/pictures2/portaits/10/100/10441.jpg'/>
            </div>
            <div className='right'>
               <h1></h1> 
            </div>
        </div>
    );
}


export default SearchResults;
